import './ProjectTile.css';
import {React} from 'react';

export const ProjectTile = () => {
    return (
        <div>
            <h1>Eto ProjectTile</h1>
            <h2>A powerful project management tool that streamlines 
                workflow, improves communication and increases 
                productivity for teams of all sizes. With features 
                like task assignment, deadline tracking, and progress 
                reporting, it makes it easier for teams to meet their goals.</h2>
        </div>
    )
}
